import './Expenses.css'
import ExpenseItem from './ExpenseItem';

function Expenses (props) {
    return (
    <div className='expenses'>
         {props.items.map((item) => {
        return <ExpenseItem 
                title={item.title}
                amount={item.amount}
                date={item.date}
              />
      })}   
    </div>
    );
}

export default Expenses;
